import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;

  .qwer {
    display: flex;
  }
  
  .zxcv {
    display: flex;
  }

`;

const Summary = (props) => {
  return <>
  <Wrapper>
    <div className="qwer">
      <img className="asdf" src="assets/images/summary.png" alt="img" />
      <div className="zxcv">
        <h1>temp</h1>
      </div>
    </div>
    
  </Wrapper>
    
  </>;
};

export default Summary;
